    false,nt"url": null,nt"notes": "The 1988 Nowitna National Wildlife Refuge
    moose survey was conducted over a 147.8 square mile portion of the Lower Nowitna
    Trend Area. A total of 409 moose was observed. Calf:cow ratios (41:100 and 48:100)
    and twinning rates (19:100) were indicative of good production and/or survival to
    six months of age for the 1988 cohort. The bull:cow ratio was 37:100. Yearling recruitment
    for the 1987 cohort was fair. The 1988 population in the trend area contained 15.
    4% yearlings and 22.7% calves. Study methods and results are discussed. Study area
    maps and data forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
